export default function Home() {
  return (
    <div className="bg-black text-white">
      <nav className="px-12 flex justify-between items-center h-20">
        <div className="flex gap-2 items-center">
          <div className="w-10 aspect-square rounded-md text">
            <img src="/assets/estsb.png" />
          </div>
          <h1 className="font-bold text-2xl">EST SB</h1>
        </div>
        <button className="bg-white text-black"></button>
      </nav>
    </div>
  );
}
